import React from 'react';

const Footer = () => {
    return (
        <div className="Footer">
            Global Burden of Disease Collaborative Network. <i>Global Burden of Disease Study 2017</i> (GBD 2017) Results.
            <br/>Seattle, United States: Institute for Health Metrics and Evaluation (IHME), 2018.
            <br/>Available from <a className="link" title="Global Burden Of Disease Tools" href="http://ghdx.healthdata.org/gbd-results-tool">http://ghdx.healthdata.org/gbd-results-tool</a>.
        </div>
    );
};

export default Footer;
